import React, { Component} from 'react';


 class Cartoonizer extends Component{
  render() {
      return(
        <div>
          <h2>Convert your photo into a cartoon</h2>
          <p>Just for 5$ your photo will be converted into a cartoon</p>
        </div>
      )

  }
}

export default Cartoonizer;
